package stringPrograms;

public class StringComparetTo {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String s1 = "Abhiq";
		String s2 = "Abhiqa";
		System.out.println(s1.compareTo(s2));
		
		/*
		 * if S1 < S2 ==== -1 return
		 * if S1 > S2 ==== 1 return
		 * if S1 = S2 == 0 return
		 */
		
	}

}
